import React, { useState } from 'react';
import { DndProvider, useDrag, useDrop } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';
import './FilterBuilder.css';

const initialModules = [
  { id: '1', content: 'rb', type: 'attribute' },
  { id: '2', content: 'drb', type: 'attribute' },
  { id: '3', content: 'galactic_latitude', type: 'attribute' },
  { id: '4', content: 'jd', type: 'attribute' },
  { id: '5', content: 'jdstarthist', type: 'attribute' },
  { id: '6', content: 'AND', type: 'operator' },
  { id: '7', content: 'OR', type: 'operator' },
  { id: '8', content: '<', type: 'comparator' },
  { id: '9', content: '<=', type: 'comparator' },
  { id: '10', content: '==', type: 'comparator' },
  { id: '11', content: '>', type: 'comparator' },
  { id: '12', content: '>=', type: 'comparator' },
  { id: '13', content: '!=', type: 'comparator' },
  { id: '14', content: 'Number', type: 'input' },
];

const ItemTypes = {
  MODULE: 'module',
};

const Module = ({ module, index, moveModule, handleModuleDoubleClick, editingIndex, inputValue, handleInputChange, handleKeyPress }) => {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: ItemTypes.MODULE,
    item: { index },
    collect: (monitor) => ({
      isDragging: monitor.isDragging(),
    }),
  }));

  const opacity = isDragging ? 0.4 : 1;

  return (
    <div ref={drag} className="module" style={{ opacity }} onDoubleClick={() => handleModuleDoubleClick(index)}>
      {editingIndex === index ? (
        <input
          type="text"
          value={inputValue}
          onChange={handleInputChange}
          onKeyPress={(e) => handleKeyPress(e, index)}
          placeholder="Enter value"
        />
      ) : (
        module.content
      )}
    </div>
  );
};

const Workspace = ({ workspace, moveModule, handleModuleDoubleClick, editingIndex, inputValue, handleInputChange, handleKeyPress }) => {
  const [, drop] = useDrop(() => ({
    accept: ItemTypes.MODULE,
    drop: (item, monitor) => {
      const delta = monitor.getDifferenceFromInitialOffset();
      const left = Math.round(item.left + delta.x);
      const top = Math.round(item.top + delta.y);
      moveModule(item.index, left, top);
    },
  }));

  return (
    <div ref={drop} className="graph-workspace">
      {workspace.map((module, index) => (
        <Module
          key={module.id}
          index={index}
          module={module}
          moveModule={moveModule}
          handleModuleDoubleClick={handleModuleDoubleClick}
          editingIndex={editingIndex}
          inputValue={inputValue}
          handleInputChange={handleInputChange}
          handleKeyPress={handleKeyPress}
        />
      ))}
    </div>
  );
};

const FilterBuilder = () => {
  const [workspace, setWorkspace] = useState([]);
  const [inputValue, setInputValue] = useState('');
  const [editingIndex, setEditingIndex] = useState(null);

  const handleModuleClick = (module) => {
    const newModule = { ...module, id: `${module.id}-${Date.now()}`, left: 0, top: 0 };
    setWorkspace([...workspace, newModule]);
    if (module.type === 'input') {
      setEditingIndex(workspace.length);
    }
  };

  const handleRemoveModule = (index) => {
    const newWorkspace = Array.from(workspace);
    newWorkspace.splice(index, 1);
    setWorkspace(newWorkspace);
  };

  const handleClearWorkspace = () => {
    setWorkspace([]);
  };

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleAddInputModule = (index) => {
    const newWorkspace = Array.from(workspace);
    newWorkspace[index].content = inputValue;
    setWorkspace(newWorkspace);
    setInputValue('');
    setEditingIndex(null);
  };

  const handleModuleDoubleClick = (index) => {
    if (workspace[index].content === 'Number') {
      setEditingIndex(index);
    } else {
      handleRemoveModule(index);
    }
  };

  const handleKeyPress = (e, index) => {
    if (e.key === 'Enter') {
      handleAddInputModule(index);
    }
  };

  const moveModule = (index, left, top) => {
    const newWorkspace = [...workspace];
    newWorkspace[index] = { ...newWorkspace[index], left, top };
    setWorkspace(newWorkspace);
  };

  const runFilter = () => {
    const documents = [
      { rb: 0.5, drb: 0.2, galactic_latitude: 5, jd: 2460318.5, jdstarthist: 2460314.5 },
      { rb: 0.5, drb: 0.99, galactic_latitude: -5, jd: 2460318.5, jdstarthist: 2460314.5 },
      { rb: 0.5, drb: 0.99, galactic_latitude: 30, jd: 2460318.5, jdstarthist: 2460300.5 },
      { rb: 0.9, drb: 0.8, galactic_latitude: 30, jd: 2460318.5, jdstarthist: 2460314.5 },
    ];

    const filterFunction = (doc) => {
      // Example filter logic based on the provided example query
      const rbOrDrb = doc.rb >= 0.8 || doc.drb >= 0.8;
      const galacticLatitude = Math.abs(doc.galactic_latitude) > 10;
      const age = doc.jd - doc.jdstarthist < 7;
      return rbOrDrb && galacticLatitude && age;
    };

    const filteredDocuments = documents.filter(filterFunction);
    console.log('Filtered Documents:', filteredDocuments);
  };

  return (
    <DndProvider backend={HTML5Backend}>
      <div className="filter-builder">
        <div className="module-palette">
          <h3>Attributes</h3>
          {initialModules.filter(module => module.type === 'attribute').map((module) => (
            <div
              key={module.id}
              className="module"
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
          <h3>Operators</h3>
          {initialModules.filter(module => module.type === 'operator').map((module) => (
            <div
              key={module.id}
              className="module"
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
          <h3>Comparators</h3>
          {initialModules.filter(module => module.type === 'comparator').map((module) => (
            <div
              key={module.id}
              className="module"
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
          <h3>Inputs</h3>
          {initialModules.filter(module => module.type === 'input').map((module) => (
            <div
              key={module.id}
              className="module"
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
        </div>
        <div className="graph-workspace-container">
          <Workspace
            workspace={workspace}
            moveModule={moveModule}
            handleModuleDoubleClick={handleModuleDoubleClick}
            editingIndex={editingIndex}
            inputValue={inputValue}
            handleInputChange={handleInputChange}
            handleKeyPress={handleKeyPress}
          />
          <button className="clear-button" onClick={handleClearWorkspace}>
            Clear Workspace
          </button>
          <button className="run-button" onClick={runFilter}>
            Run
          </button>
        </div>
      </div>
    </DndProvider>
  );
};

export default FilterBuilder;
